function UlFlex(props) {
    const css = {
        ul : {
            width: '100%',
            height: '112px',
            backgroundColor: '#070e17',
            listStyleType: 'none',
            display: 'flex'
        }



    }


    if (props.count === 4) {
        return (
            <div>
                <ul style={css.ul}>
                    <li><img src={props.img[0]} alt=""/></li>
                    <li><img src={props.img[1]} alt=""/></li>
                    <li><img src={props.img[2]} alt=""/></li>
                    <li><img src={props.img[3]} alt=""/></li>
                </ul>
            </div>
        )
    } else if (props.count === 6) {
        return (
            <div>
                <ul>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>


            </div>
        )
    } else {
        console.log('ERROR IN UlFlex.js')
    }


}
export default UlFlex;
